import React, { useState } from 'react';
import { View, Text, TextInput, TouchableOpacity, StyleSheet, Image, onPress } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';

const OrderScreen = ({navigation}) => {
  const [showDetails, setShowDetails] = useState(false);
  
  const toggleDetails = () => {
    setShowDetails(!showDetails);
  };
  
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <TouchableOpacity onPress={() => navigation.goBack()}>
          <Icon name="bars" size={20} color="black" style={styles.bars} />
        </TouchableOpacity>
        <View style={styles.logoContainer}>
          <Image
            source={require('../img/logo.png')}
            style={styles.logoimage}
            accessible={true}
            accessibilityLabel={'logo'}
          />
        </View>
      </View>
      <TouchableOpacity style={styles.orderButton} onPress={toggleDetails}>
        <Text style={styles.orderNo}>Order No. 12345</Text>
        <View style={styles.orderDetails}>
          <Text style={styles.orderDate}>June 3, 2023</Text>
          <Icon name={showDetails ? "angle-up" : "angle-down"} size={20} color="black" />
        </View>
      </TouchableOpacity>
      {showDetails && (
        <View style={styles.orderDetailsContainer}>
          <View style={styles.orderDetail}>
            <Image
              source={require('../img/Lawn.png')}
              style={styles.productImage}
              accessible={true}
              accessibilityLabel={'product1'}
            />
            <View style={styles.productDetails}>
              <Text style={styles.productName}>Product 1</Text>
              <Text style={styles.productPrice}>$10.00</Text>
            </View>
          </View>
          <View style={styles.orderDetail}>
            <Image
              source={require('../img/Lawn.png')}
              style={styles.productImage}
              accessible={true}
              accessibilityLabel={'product2'}
            />
            <View style={styles.productDetails}>
              <Text style={styles.productName}>Product 2</Text>
              <Text style={styles.productPrice}>$15.00</Text>
            </View>
          </View>
          <View style={styles.orderDetail}>
            <Image
              source={require('../img/Lawn.png')}
              style={styles.productImage}
              accessible={true}
              accessibilityLabel={'product3'}
            />
            <View style={styles.productDetails}>
              <Text style={styles.productName}>Product 3</Text>
              <Text style={styles.productPrice}>$20.00</Text>
            </View>
          </View>
          <View style={styles.orderTotal}>
            <Text style={styles.orderTotalLabel}>Total:</Text>
            <Text style={styles.orderTotalValue}>$45.00</Text>
          </View>
        </View>
      )}
      <View style={styles.footer}>
        <Text style={styles.footerText}>Footer Text</Text>
      </View>
    </View>
  );
};


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F2F2F2',
  },
  header: {
    height: 74,
    flexDirection: 'row',
    backgroundColor: 'white',
    justifyContent: 'center',
    alignItems: 'center',
    paddingHorizontal: 10,
  },
  bars: {
    marginRight: 'auto',
  },
  logoContainer: {
    alignItems: 'center',
    width: '50%',
  },
  logoimage: {
    width: 208,
    height: 41,
  },
  orderButton: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    backgroundColor: 'white',
    paddingVertical: 10,
    paddingHorizontal: 20,
    marginTop: 20,
  },
  orderNo: {
    fontWeight: 'bold',
    fontSize: 16,
    letterSpacing: 2,
  },
  orderDetails: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  orderDate: {
    marginRight: 10,
    fontSize: 14,
  },
  orderDetailsContainer: {
    backgroundColor: 'white',
    paddingHorizontal: 20,
    paddingVertical: 10,
    borderTopWidth: 1,
    borderBottomWidth: 1,
    borderColor: '#ddd',
    borderRadius: 15,
    width: 250,
    justifyContent: "center",
    // alignItems: 'center',
    // position: "absolute",
    // right: 0,
  },
  orderDetail: {
    flexDirection: 'row',
    justifyContent: 'center',
    marginBottom: 10,
    width: 200,
    height: "auto",
  },
  productImage: {
    width: 50,
    height: 50,
    resizeMode: 'contain',
    marginRight: 10,
  },
  productDetails: {
    flexShrink: 1,
  },
  productName: {
    fontWeight: 'bold',
    fontSize: 14,
  },
  productPrice: {
    fontWeight: 'bold',
    fontSize: 14,
    color: '#888',
  },
  orderTotal: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    marginTop: 10,
  },
  orderTotalLabel: {
    fontWeight: 'bold',
    fontSize: 16,
  },
  orderTotalValue: {
    fontWeight: 'bold',
    fontSize: 16,
  },
  footer: {
    height: 74,
    backgroundColor: 'white',
    alignItems: 'center',
    justifyContent: 'center',
    paddingHorizontal: 10,
    position: 'absolute',
    bottom: 0,
    left: 0,
    right: 0,
  },
});

export default OrderScreen;
